export default function Button({ children }) {
  return (
    <>
      <button className="px-6 py-2 bg-blue-500 text-white rounded-lg shadow-md hover:bg-blue-600 transition duration-300 ease-in-out">
        {children}
      </button>
    </>
  );
}
